import React, { useState } from "react";
import "./Main.css";
import { Link } from "react-router-dom";

export const Main = () => {
  const [currentSlide, setCurrentSlide] = useState(0);
  const [spotlightIndex, setSpotlightIndex] = useState(0);

  // Function to handle left button click for New Arrival
  const handleClickLeft = () => {
    setCurrentSlide((prevSlide) => (prevSlide === 0 ? 4 : prevSlide - 1));
  };

  // Function to handle right button click for New Arrival
  const handleClickRight = () => {
    setCurrentSlide((prevSlide) => (prevSlide === 3 ? 0 : prevSlide + 1));
  };

  // Function to handle left button click for Spotlight
  const handleSpotlightLeft = () => {
    setSpotlightIndex((prevIndex) => (prevIndex === 0 ? 4 : prevIndex - 1));
  };

  // Function to handle right button click for Spotlight
  const handleSpotlightRight = () => {
    setSpotlightIndex((prevIndex) => (prevIndex === 3 ? 0 : prevIndex + 1));
  };

  return (
    <>
      {/* Spotlight Section */}
      <div className="spotlight">
        <div className="container">
          <div className="left">
            <h1>T-Shirt / Tops</h1>
            <h2>Summer <br /> Value Pack</h2>
            <p>cool / colorful / comfy</p>
            <button className="btn">Shop Now</button>
            <img
              src={`assets/carousel-${spotlightIndex + 1}.png`}
              alt="carousel"
            />
          </div>
        </div>

        {/* Spotlight Arrows */}
        <button className="slide-btn left-btn" onClick={handleSpotlightLeft}>
          <img src="/assets/.png" alt="left arrow" />
        </button>
        <button className="slide-btn right-btn" onClick={handleSpotlightRight}>
          <img src="/assets/arrow-right.png" alt="right arrow" />
        </button>
      </div>

      {/* New Arrival Section */}
      <div className="new-arrival wrapper">
        <div className="top">
          <img src="assets/Rectangle 21.png" alt="new arrival" />
          <h1>New Arrival</h1>
        </div>
        <div className="bottom">
          <div className="container">
            <ul
              className="image-list"
              style={{ transform: `translateX(-${currentSlide * 25}%)` }}
            >
              <li>
                <img
                  src="assets/photographer-white-background.png"
                  alt="knitted joggers"
                />
                <p>Knitted Joggers</p>
              </li>
              <li>
                <img src="/assets/img-3.jpg" alt="full sleeve" />
                <p>Full Sleeve</p>
              </li>
              <li>
                <img src="/assets/img-4.jpg" alt="active t-shirts" />
                <p>Active T-Shirts</p>
              </li>
              <li>
                <img src="/assets/img-2.jpg" alt="urban shirts" />
                <p>Urban Shirts</p>
              </li>
            </ul>
          </div>
        </div>


        <button className="slide-btn left-btn" onClick={handleClickLeft}>
          <img src="/assets/arrow-left.png" alt="left arrow" />
        </button>
        <button className="slide-btn right-btn" onClick={handleClickRight}>
          <img src="/assets/arrow-right.png" alt="right arrow" />
        </button>
      </div>
    </>
  );
};
